import React from 'react';
import {useAuth0} from '@auth0/auth0-react';

const LoginButton = () => {

    const {loginWithRedirect, isAuthenticated} = useAuth0();
    return(
        !isAuthenticated && (
          <a class="nav-link" href="#" onClick={() => loginWithRedirect()}>Log In</a>
        )
    )
}

export default LoginButton;
